import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  /* background: #66d9e8; */
  width: 100%;
`;

const ContentsGroup = styled.div`
  width: 1320px;
  display: flex;
  justify-content: space-between;
  height: 200px;
`;

const Boxex = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  text-align: center;
  width: 300px;
  height: 200px;
  border: 1px solid red;
  font-weight: bold;

  .spanHead {
    margin-bottom: 0;
  }
  .spanText {
    padding: 0;
    background: gold;
    margin-top: 1rem;
    font-size: 3rem;
    font-weight: bold;
    border-radius: 4px;
  }
`;

const PricingPolicy = () => {
  return (
    <Container>
      <ContentsGroup>
        <Boxex>
          <p className="spanHead">월 사용자 수</p>
          <p className="spanText">1000명</p>
        </Boxex>
        <Boxex>
          <p>평균 가격정책</p>
          <p className="spanText">35,000원</p>
        </Boxex>
        <Boxex>A</Boxex>
      </ContentsGroup>
    </Container>
  );
};

export default PricingPolicy;
